import { CSSProperties } from "react";

interface VectorGraphicProps {
  path: string;
  color?: string;
  styles?: CSSProperties;
  className?: string;
  preserveRatio?: boolean;
}

function VectorGraphic(props: VectorGraphicProps) {
  // The "Happy" eyes are composed of the following base layers in this pattern
  let path = props.path.replace(
    "^^",
    "/Happy//Happy2//Happy3//Happy2//Happy4/"
  );
  let customSize;
  let size = [0, 0, 512, 512];
  let propClass = "icon " + (props.className ? props.className + " " : "");
  let propStyles = props.styles;

  // Checking for custom dimensions to allow centering
  if (path.includes("|")) {
    [customSize, path] = path.split("|");
    let sizePoints = customSize.split(", ").map((item) => parseInt(item));
    let startIndex = 2;
    if (sizePoints.length > 2) {
      startIndex = 0;
    }
    for (let i = 0; i < sizePoints.length && startIndex < size.length; i++) {
      size[startIndex] = sizePoints[i];
      startIndex++;
    }
    const [width, height] = [size[2] - size[0], size[3] - size[1]];
    if (width > height) {
      propClass += "icon-wide";
    } else if (width < height) {
      propClass += "icon-tall";
    } else {
      propClass += "icon-square";
    }
    propStyles = {
      ...propStyles,
      ...{
        "--aspect-ratio": width / height,
      },
    };
  } else {
    propClass += "icon-square";
  }
  if (path.includes("/")) {
    let splitPath = path.split("/");
    // Every odd numbered value in the split array should be a path reference
    for (let i = 1; i < splitPath.length; i += 2) {
      if (splitPath[i] in iconBases) {
        splitPath[i] = iconBases[splitPath[i] as keyof typeof iconBases];
      }
    }
    path = splitPath.join("");
  }
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox={size.join(", ")}
      style={propStyles}
      className={propClass}
      preserveAspectRatio={props.preserveRatio ? "xMidYMid meet" : "none"}
    >
      <path fill={props.color} d={path}></path>
    </svg>
  );
}

export default VectorGraphic;

